Eixo - 0005. DEFESA DE ÁREA MARÍTIMA E FLUVIAL.
Atividade - Recuperação e manutenção das estruturas administrativas e 
operativas das Organizações Militares subordinadas que participarão da OPERAÇÃO 
COPA DO MUNDO.
Metas:
I) Restauração antena nº 1 do Posto de Recepção - R$ 40.000,00; 
II) Restauração antena nº 4 do Posto de Recepção - R$ 40.000,00;
III)  Restauração antena nº 1 do Posto de Transmissão - R$ 40.000,00;
IIII) Restauração antena nº 4 do Posto de Transmissão - R$ 40.000,00, da Estação Radiogoniométrica da Marinha em Natal.

Contratação de bens e serviços para provisão da continuidade operacional dos serviços de tecnologia da informação e a capacidade de processamento de dados da Anatel em caso de desastres e graves incidentes que impactem negativamente a atual infraestrutura de TI.
- Adequação da infraestrutura de Tecnologia da Informação;
- Redundância interna do parque computacional da Agência;
- Migração da redundância interna para um ambiente externo, em outro órgão da APF.
